import { useHistory } from "react-router-dom/cjs/react-router-dom.min";
import NavBar from "../NavBar";

const ViewPage = () => {
  const history = useHistory();
  const goBack = () => {
    history.push("/");
  };
  return (
    <>
      <NavBar />
      <button onClick={goBack} style={{ background: "#e7e7e7", color: "#666" }}>
        Go back
      </button>
    </>
  );
};
export default ViewPage;
